using System;\nusing System.Collections.Generic;\nusing YourJiraSoapNamespace; // replace with your JIRA WSDL imported namespace\n\nclass Program\n{\n    static void Main(string[] args)\n    {\n        JiraSoapService jira = new JiraSoapService();\n        string token = jira.login("yourusername", "yourpassword"); // login to get a session token\n\n        string projectName = "YOUR_PROJECT_KEY"; // replace with your project key\n        RemoteUser[] users = jira.getUsersForProject(token, projectName);\n\n        Console.WriteLine($"Assignable users for {projectName}:");\n        foreach (RemoteUser user in users)\n        {\n            Console.WriteLine($"{user.name} - {user.fullName}");\n        }\n\n        jira.logout(token); // logout\n    }\n}